"""This is the module which holds the data files"""

#Imported modules
import base64
import subprocess
from os import remove

icons = ''''''

exe_7z = ''''''

def icons_creator():
    decoded = base64.b64decode(icons)
    file = open('icons.7z', 'wb')
    file.write(decoded)
    file.close()
    command = subprocess.Popen(['7z', 'e', 'icons.7z' ,'-oicons\\','-y'], shell = True)
    command.wait()
    remove('icons.7z')

